import React from "react";
import {Link, Routes, Route, Outlet} from 'react-router-dom';
import Router from './Router';

const Page = () => {
    return (
        <div>
            <h1> Posting </h1>
            <ul id="ulNone">
                <li id="liNone">
                    <Link to={43}>Article #43</Link>
                </li>
            </ul>
            <Outlet />
        </div>
    )
}

export default Page;
